import './App.css';
import React from 'react';
import { connect } from 'react-redux';
import DashboardView from './components/DashboardView';
import LinkTileView from './components/LinkTileView';
import { fetchPhoto, togglePhoto } from './actions/photoActions';

class App extends React.Component {
  componentDidMount() {
    this.props.fetchPhoto();
  }

  render(){
      return (
        <div>
          {this.props.viewDetails.view === "dashboard" ? <DashboardView /> : <LinkTileView />}
        </div>
        )
    }
  }

  function mapStateToProps(state, ownProps) {
    return {
      viewDetails: state.viewDetails,
      photoDetails: state.photoDetails
    }
  }

export default connect(mapStateToProps, { fetchPhoto })(App);
